var app=angular.module("useful.filters",[]);app.filter("utFilter",function(){return function(a,d){if(d!=""&&!_.isUndefined(d)&&!_.isNull(d)){var c=new RegExp(d,"i");var b=_.filter(a,function(e){return e.name.search(c)>-1||e.description.search(c)>-1||_.some(e.tags,function(f){return f.search(c)>-1})});return b}return a}});